import React from "react";
import styled from "@emotion/styled";

export function Hero1() {
  return (
    <Wrapper>
      <ContentBox>
        <Title>
          Hello, Iâ€™m <span className="highlight">Sarvagya</span>
        </Title>
        <Subtitle>Electrical Engineering and Computer Science Student</Subtitle>
        <UniversityText>
          University of California, <span className="highlight-blue">Berkeley</span>
        </UniversityText>

        <ButtonContainer>
          <Button>About</Button>
          <Button>Experiences</Button>
          <Button>Projects</Button>
          <Button>Research</Button>
          <Button>Contact</Button>
        </ButtonContainer>
      </ContentBox>

      <SocialContainer>
        <SocialIcon href="https://www.linkedin.com" aria-label="LinkedIn">
          <LinkedInIcon xmlns="http://www.w3.org/2000/svg">
            <path fill="currentColor" d="M28 12c3.1826 0 6.2349 1.2643 8.4853 3.5147C38.7357 17.7652 40 20.8174 40 24v14h-8V24c0-1.0609-.4214-2.0783-1.1716-2.8284S29.0609 20 28 20s-2.0783.4214-2.8284 1.1716S24 22.9391 24 24v14h-8V24c0-3.1826 1.2643-6.2348 3.5147-8.4853C21.7652 13.2643 24.8174 12 28 12zM8 14h8v24H8V14zm4-10C9.2386 4 8 5.2386 8 6.5s1.2386 2.5 2.5 2.5S13 7.7614 13 6.5 11.7614 4 10 4z"/>
          </LinkedInIcon>
        </SocialIcon>
        <SocialIcon href="https://github.com" aria-label="GitHub">
          <GitHubIcon xmlns="http://www.w3.org/2000/svg">
            <path fill="currentColor" d="M14 36.05C4 39.05 4 31.05 0 30.05M28 42.05V34.31c.08-.95-.05-1.91-.38-2.81a8 8 0 00-1.5-1.4c6.3-.7 12.9-3.08 12.9-13C38.9 12.3 37.9 9.6 36 7.6c.9-2.4.8-5.1-.2-7.6 0 0-2.4-.7-8 2.9a24.9 24.9 0 00-14 0c-5.6-3.6-8-2.9-8-2.9-.9 2.5-.9 5.2 0 7.6-2 2-3.1 4.7-3 7.5 0 10.8 6.6 13.2 12.9 14-.6.8-1.1 1.6-1.4 2.5-.3.9-.4 1.8-.4 2.7v7.8"/>
          </GitHubIcon>
        </SocialIcon>
      </SocialContainer>
    </Wrapper>
  );
}

const Wrapper = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  height: 100vh;
  background-color: #fafafa;
`;

const ContentBox = styled.div`
  background-color: #f5f5f5;
  padding: 2rem;
  border-radius: 20px;
  box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1);
  text-align: center;
  max-width: 400px;
`;

const Title = styled.h1`
  font-size: 1.4rem;
  font-weight: bold;
  color: #333;
  margin: 0;
  .highlight {
    font-weight: bold;
  }
`;

const Subtitle = styled.h2`
  font-size: 1rem;
  font-weight: 500;
  color: #666;
  margin-top: 0.5rem;
  margin-bottom: 0.3rem;
`;

const UniversityText = styled.h3`
  font-size: 0.9rem;
  color: #666;
  margin: 0;
  .highlight-blue {
    color: #0056b3;
  }
`;

const ButtonContainer = styled.div`
  display: flex;
  flex-direction: column;
  gap: 0.4rem;
  margin-top: 1rem;
`;

const Button = styled.button`
  background-color: #e6e6e6;
  border: none;
  padding: 0.6rem;
  border-radius: 8px;
  cursor: pointer;
  font-size: 0.9rem;
  text-align: center;
  transition: background-color 0.2s;

  &:hover {
    background-color: #d9d9d9;
  }
  &:active {
    background-color: #c9c9c9;
  }
`;

const SocialContainer = styled.div`
  display: flex;
  gap: 1rem;
  margin-top: 1.5rem;
`;

const SocialIcon = styled.a`
  width: 40px;
  height: 40px;
  display: flex;
  align-items: center;
  justify-content: center;
  color: #333;
  background-color: #e6e6e6;
  border-radius: 50%;
  transition: background-color 0.2s;

  &:hover {
    background-color: #d9d9d9;
  }
`;

const LinkedInIcon = styled.svg`
  width: 24px;
  height: 24px;
`;

const GitHubIcon = styled.svg`
  width: 24px;
  height: 24px;
`;

export default Hero1;
